const n={docsHtml:`<p><code>@mdui/icons</code> is a standalone package that contains all the Material Icons, with each icon as an independent file.</p>
<p>You can import only the icons you need without having to import the entire icon library. Therefore, using <code>@mdui/icons</code> can significantly reduce the size of your project bundle compared to using the <a href="https://cdn.w3cbus.com/en/docs/2/components/icon"><code>&lt;mdui-icon&gt;</code></a> component.</p>
<h2 id="installation">
                  <a href="#installation">Installation</a>
                </h2>
<p>You can install the package independently:</p>
<pre><code class="language-bash">npm install @mdui/icons --save
</code></pre>
<h2 id="usage">
                  <a href="#usage">Usage</a>
                </h2>
<p>After installation, you can import the necessary icon files:</p>
<pre><code class="language-js">import &#39;@mdui/icons/search.js&#39;;
</code></pre>
<p>Then, you can utilize the corresponding icon component in your HTML:</p>
<pre><code class="language-html">&lt;mdui-icon-search&gt;&lt;/mdui-icon-search&gt;
</code></pre>
`,elements:[]};export{n as default};
